import React, { Component } from 'react';
import { withRouter, Link } from 'react-router-dom';
import '../App.css';
import Swal from "sweetalert2";
import logo from '../assets/images/logo.png';

class Register extends Component {
  constructor(props){
    super(props);
    this.state = {
      username: '',
      emai: '',
      password: '',
      isLoading: false,
      isDisabled: false
    }
  }

  validateForm = () => {
    const { username, password } = this.state;
    if(username.length == 0){
      Swal.fire({
        title: "Empty!",
        text: "Please enter username",
        icon: "error",
        confirmButtonText: "OK",
      });
    }else if(password.length == 0){
      Swal.fire({
        title: "Empty!",
        text: "Please enter password",
        icon: "error",
        confirmButtonText: "OK",
      });
    }
  }

  doRegister = () => {
    const { username, password } = this.state;

    // console.warn(formatPhone);
    this.setState({isLoading: true, isDisabled: true})
    let req = {
      method: "POST",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        name: "+234",
        email: "+234",
        password: password,

      }),
    };
    fetch(`${baseUrl}Users/login`, req)
      .then((response) => response.json())
      .then((responseJson) => {
        if(responseJson.Message === "Login Sucessfull"){
          this.setState({isLoading: false, isDisabled: false})
          // console.warn(responseJson);
          try {
            const items = [
              ['userid', responseJson.userId],
              ['usertype', 'logistics'],
              ['email', responseJson.Email],
              ['token', responseJson.Token],
            ];
            AsyncStorage.multiSet(items).then(() => {
              // RNRestart.Restart();
              Platform.OS === "ios" ? Alert.alert("Login successful.") :
              ToastAndroid.showWithGravity(
               "Login successful",
               ToastAndroid.LONG,
               ToastAndroid.CENTER
             );
              // this.props.navigation.navigate('LogisticsDashboard');
            });
            //Showing response message coming from server after inserting records.
          } catch (error) {
            this.setState({
              isLoading: false,
              isDisabled: false
            });
            Platform.OS === "ios" ? Alert.alert("An error occurred. Please try again later.") :
            ToastAndroid.showWithGravity(
             "An error occurred. Please try again later.",
             ToastAndroid.LONG,
             ToastAndroid.CENTER
           );
          }

        }else{
          Platform.OS === "ios" ? Alert.alert("An error occurred. Please try again later.") :
          ToastAndroid.showWithGravity(
           "An error occurred. Please try again later.",
           ToastAndroid.LONG,
           ToastAndroid.CENTER
         );
         this.setState({
           isLoading: false,
           isDisabled: false
         });
        }
      })
      .catch((error) => {
        this.setState({isLoading: false, isDisabled: false})
        Platform.OS === "ios" ? Alert.alert("An error occurred. Please try again later.") :
        ToastAndroid.showWithGravity(
         "An error occurred. Please try again later.",
         ToastAndroid.LONG,
         ToastAndroid.CENTER
       )
      })
    }

  render(){
    const { isLoading, isDisabled } = this.state;
    return(
      <div class="container">
      <div class="row">
        <div class="col-md-6 offset-md-3">
          <h2 class="text-center text-dark mt-5">Account Registration</h2>
          <div class="text-center mb-5 text-dark">App Academy</div>
          <div class="card my-5">

            <form class="card-body cardbody-color p-lg-5">

              <div class="text-center">
                <img src={logo} class="img-fluid profile-image-pic img-thumbnail my-3"
                  width="200px" alt="logo" />
              </div>

              <div class="mb-3">
                <input type="text" class="form-control" id="Username" aria-describedby="Username"
                  placeholder="User Name" />
              </div>
              <div class="mb-3">
                <input type="text" class="form-control" id="email" aria-describedby="Email"
                  placeholder="Email" />
              </div>
              <div class="mb-3">
                <input type="password" class="form-control" id="password" placeholder="password" />
              </div>
              <div class="text-center"><button type="button" disabled={isDisabled} onClick={(e) => this.validateForm()} class="btn btn-danger font-weight-bold px-5 mb-5 w-100">Create Account</button></div>
              <div id="emailHelp" class="form-text text-center mb-5 text-dark">Already
                Registered? <Link to="/login" class="text-dark fw-bold">Login</Link>
              </div>
            </form>
          </div>

        </div>
      </div>
    </div>
    )
  }
}

export default withRouter(Register)
